import React from 'react'
import styled from 'styled-components'

function SideBar() {
  return (
    <Container>
        <nav>
            <ul>
                <li>
                    <a href="#">
                        <span class="icon"><i class="fas fa-home"></i></span>
                        <span class="item">Health & Beauty</span>
                    </a>
                </li>
                <li>
                    <a href="#" >
                        <span class="icon"><i class="fas fa-home"></i></span>
                        <span class="item">Home & Office</span>
                    </a>
                </li>
                <li>
                    <a href="#">
                        <span class="icon"><i class="fas fa-home"></i></span>
                        <span class="item">Appliances</span>
                    </a>
                </li>
                <li>
                    <a href="#">
                        <span class="icon"><i class="fas fa-home"></i></span>
                        <span class="item">Phones & Tablets</span>
                    </a>
                 </li>
                 <li>
                    <a href="#">
                        <span class="icon"><i class="fas fa-home"></i></span>
                        <span class="item">Computing</span>
                    </a>
                 </li>
                 <li>
                    <a href="#">
                        <span class="icon"><i class="fas fa-home"></i></span>
                        <span class="item">Electronics</span>
                    </a>
                 </li>
                 <li>
                    <a href="#">
                        <span class="icon"><i class="fas fa-home"></i></span>
                        <span class="item">Fashion</span>
                    </a>
                 </li>
                 <li>
                    <a href="#">
                        <span class="icon"><i class="fas fa-home"></i></span>
                        <span class="item">Gaming</span>
                    </a>
                 </li>
                 <li>
                    <a href="#">
                        <span class="icon"><i class="fas fa-home"></i></span>
                        <span class="item">Baby Products</span>
                    </a>
                 </li>
                 <li>
                    <a href="#">
                        <span class="icon"><i class="fas fa-home"></i></span>
                        <span class="item">Sporting</span>
                    </a>
                 </li>
            </ul>
        </nav>
    </Container>
  )
}

const Container=styled.div`
    width:100%;
    flex:0.15;
    background: #fff;
    border-radius: 10px;
    margin: 19px 18px 0 18px;
    height: fit-content;
    flex:0.2;

    nav{
        ul{
            list-style: none;
            text-decoration: none;
            box-sizing: border-box;

            li{
                border:none;
                margin-top:0.5rem;
                a{
                    text-decoration: none;
                    color: black;
                }
                a:hover{
                    color: orange;
                }
            }
            li:hover{
                color: orange;
            }
        }
    }
`;
export default SideBar
